umnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"42989","type":"CustomJS"},{"attributes":{"coordinates":null,"group":null},"id":"43022","type":"Title"},{"attributes":{"active_drag":{"id":"42641"},"active_scroll":{"id":"42642"},"tools":[{"id":"42641"},{"id":"42642"},{"id":"42643"},{"id":"42644"},{"id":"42645"},{"id":"42646"},{"id":"42647"},{"id":"42670"},{"id":"42990"}]},"id":"42649","type":"Toolbar"},{"attributes":{"coordinates":null,"formatter":{"id":"42978"},"group":null,"major_label_policy":{"id":"42979"},"ticker":{"id":"42943"},"visible":false},"id":"42942","type":"LinearAxis"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"42794","type":"BoxAnnotation"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/N4G1MOMr8D8TZOH7BB/wP6L0B39NSvA/nMUNdHt98D9YgrO18UDwPw5D0sgaTvA/xldz67JC8D+QDl3LyijvPw0xYtBeJe8/
